const stockMarketData = [
	{ stockName: 'Apple', ticker: 'AAPL', startingPrice: 70, priceRange: 100 },
	{ stockName: 'Tesla', ticker: 'TESL', startingPrice: 80, priceRange: 700 },
	{ stockName: 'Facebook', ticker: 'FB', startingPrice: 80, priceRange: 100 },
];

export default stockMarketData;
